import styled from 'styled-components';

const Button = styled.button`
  color: ${({ theme }) => theme.black};
  padding: 0;
  margin: 20px;
  width: 220px;
  height: 47px;
  border: 0.5 solid ${({ theme }) => theme.black};
  border-radius: 50px;
  font-size: ${({ theme }) => theme.fontSize.s};
`;

export default Button;
